script: |
  super -f text -I q12194.spq | sort > q12194.out

inputs:
  - name: q12194.spq
    data: |
      SELECT 71 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE 89 NOT BETWEEN 5 + col2 * - ( - col1 * 4 ) AND NULL;
  - name: tab0

outputs:
  - name: q12194.out
    data: |
      71
      71
      71
